import React, {Component} from 'react';
import {getCV} from "../api/apiCalls";

class CvList extends Component {

    state = {
        cvs: []
    }

    componentDidMount() {
        getCV().then(response => {
            this.setState({
                cvs: response.data
            });
        });
    }

    render() {
        const {cvs} = this.state;
        return (
            <div>
                {cvs.map(function (cv, index) {
                    return (
    <div>
        cv.username
    </div>
                    )
                })

                }
            </div>
        );
    }
}

export default CvList;
